import styled from 'styled-components';

export const Container = styled.footer`
  /*grid-column-start: 1;
  grid-column-end: 3;*/
  grid-area: footer;

  /*height: 60px;*/
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  background-color: #434c5b;
  font-family: Roboto, sans-serif;
  color: #eee;
`;
